import React from 'react'
import { Link } from 'react-router-dom'
import { Button} from 'reactstrap';

const Content = () => {
  return (
    <div className='contentpage'>
        <div className="left">
        <Button color='success' type='submit'><Link to="/orders">View all orders</Link></Button>
        </div>
        <div className="right">
            This is right side
        </div>
    </div>
  )
}

export default Content
